script: |
  super -f text -I q536.spq | sort > q536.out

inputs:
  - name: q536.spq
    data: |
      SELECT d
      FROM t1 (FORMAT parquet)
      WHERE coalesce(a,b,c,d,e)<>0
      AND d NOT BETWEEN 110 AND 150;
  - name: t1

outputs:
